	(1,'开业大典','&lt;p style=&quot;white-space: normal;&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;活动规则&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;white-space: normal; line-height: 0;&quot;&gt;&lt;span class=&quot;--mb--rich-text&quot; data-boldtype=&quot;0&quot; style=&quot;font-family: SourceHanSansSC; font-size: 12px; color: rgb(16, 16, 16); letter-spacing: 0px; line-height: 18px;&quot;&gt;为了答谢广大用户积极参与云饰网开业典礼，特举行开业抽奖&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;white-space: normal; line-height: 0;&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;white-space: normal; line-height: 0;&quot;&gt;&lt;span class=&quot;--mb--rich-text&quot; data-boldtype=&quot;0&quot; style=&quot;font-family: SourceHanSansSC; font-weight: 700; font-size: 12px; color: rgb(16, 16, 16); letter-spacing: 0px; line-height: 18px;&quot;&gt;活动时间：&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;white-space: normal; line-height: 0;&quot;&gt;&lt;span class=&quot;--mb--rich-text&quot; data-boldtype=&quot;0&quot; style=&quot;font-family: SourceHanSansSC; font-size: 12px; color: rgb(16, 16, 16); letter-spacing: 0px; line-height: 18px;&quot;&gt;2019年1月21日 00：00至2019年1月29日 23:59&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;white-space: normal; line-height: 0;&quot;&gt;&lt;span class=&quot;--mb--rich-text&quot; data-boldtype=&quot;0&quot; style=&quot;font-family: SourceHanSansSC; font-size: 12px; color: rgb(16, 16, 16); letter-spacing: 0px; line-height: 18px;&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;white-space: normal; line-height: 0;&quot;&gt;&lt;span class=&quot;--mb--rich-text&quot; data-boldtype=&quot;0&quot; style=&quot;font-family: SourceHanSansSC; font-weight: 700; font-size: 12px; color: rgb(16, 16, 16); letter-spacing: 0px; line-height: 18px;&quot;&gt;活动条件：&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;white-space: normal; line-height: 0;&quot;&gt;&lt;span class=&quot;--mb--rich-text&quot; data-boldtype=&quot;0&quot; style=&quot;font-family: SourceHanSansSC; font-size: 12px; color: rgb(16, 16, 1